import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from './Common/Component/Header';
import Footer from './Common/Component/Footer';
// import CafeHeader from './Common/Component/Header/CafeHeader';
import Home from './Views/Home/index';
import Login from './Views/Login/Login';
import Cart from './Views/Cart';
import Register from './Views/Register/Register';
import FindId from './Views/FindId/FindId';
import FindPw from './Views/FindPw/FindPw';
import Profile from './Views/Subfolder/Profile/index';
import Diary from './Views/Subfolder/Diary/index';
import SWOT from './Views/Subfolder/SWOT/index';
import LifeMap from './Views/Subfolder/LifeMap';


const App = () => {
  return (
    <Router>
      <Header />
       <Routes>

        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login />} />
        <Route path="/Register" element={<Register />} />
        <Route path="/FindId" element={<FindId />} />
        <Route path="/FindPw" element={<FindPw />} />
        <Route path="/Cart" element={<Cart />} />
        <Route path="/Profile" element={<Profile />} />
        <Route path="/Diary" element={<Diary />} />
        <Route path="/SWOT" element={<SWOT />} />
        <Route path="/LifeMap" element={<LifeMap />} />

      </Routes>
      <Footer />
    </Router>
  );
};


